import * as S from "./styles";
import { useState } from "react";
import Animation01 from "../../components/animations/animation01";

export default function Animations() {
  const [isAnimation01, setIsAnimation01] = useState(false);
  function onAnimation01() {
    setIsAnimation01(!isAnimation01);
  }

  return (
    <S.Container>
      <section className="boxAll">
        <h1>Animações</h1>
        <section>
          <Animation01 />
        </section>
      </section>
    </S.Container>
  );
}
